var unpack_all = list_of_files.length<=0;

function ensureDirectoryExistence(filePath) {
    var dirname = path.dirname(filePath);
    if(fs.existsSync(dirname)){
        return true;
    };
    ensureDirectoryExistence(dirname);
    fs.mkdirSync(dirname);
};

await (new Promise((resolve, reject) => {
    var readStream = fs.createReadStream(archive_path);
    readStream.on("error", function error(e) {
        reject(e);
    });
    var parse = readStream.pipe(unzipper.Parse());
    parse.on('entry', function (entry){
        var isUnicode = entry.props.flags.isUnicode;
        var filePath = isUnicode ? entry.path : il.decode(entry.props.pathBuffer, 'cp866');
        var fullPath = destination_path + '/' + filePath;
        var fileType = entry.type;
        if(unpack_all || list_of_files.indexOf(filePath) > -1){
            if(fileType==="File"){
                ensureDirectoryExistence(fullPath);
                var writeStream = entry.pipe(fs.createWriteStream(fullPath));
                writeStream.on("error", function error(e) {
                    reject(e);
                });
            }else{
                if(!fs.existsSync(fullPath)){
                    ensureDirectoryExistence(fullPath);
                    fs.mkdirSync(fullPath);
                };
            };
            var autodrain = entry.autodrain();
            autodrain.on("error", function error(e) {
                reject(e);
            });
        }else{
            var autodrain = entry.autodrain();
            autodrain.on("error", function error(e) {
                reject(e);
            });
        };
    });
    parse.on("error", function error(e) {
        reject(e);
    });
    parse.on("close", function close() {
        resolve();
    });
}));

